import React from "react";

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <ImageToggleOnMouseOver primaryImage="../static/speakers/bw/Speaker-187.jpg" primaryImage="../static/speakers/bw/Speaker-187.jpg" alt="" />
        &nbsp;&nbsp;&nbsp;
            <ImageToggleOnMouseOver primaryImage="../static/speakers/bw/Speaker-1124.jpg" secondaryImage="../static/speakers/bw/Speaker-1124.jpg" alt="" />
        </div>
    )   
}
export default ImageChangeOnMouseOver
